import React , {useState} from "react"

export default function Counter (){
    const[counter, setCounter] = useState(0)

    const handleCounter = () =>{
        setCounter(prev=>prev+1)
    }   

    return(
        <div>
               <button onClick={handleCounter}>Count {counter}</button>
        </div>
    );

}
